INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES ("2020/04/30 12:00:00", 1, 0.0, 0, 0.0, 1, 0.0, 24, "あたしだって\nやるときはやるよ！", "2030/12/17 14:59:59", "リン", 24001, 10040, 102601);
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES ("2020/04/30 12:00:00", 1, 0.0, 1, 0.0, 1, 0.0, 24, "ふぅ…\nこれであたしの仕事は\n終わりだね", "2030/12/17 14:59:59", "リン", 24002, 10040, 102601);
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES ("2020/04/30 12:00:00", 1, 0.0, 2, 0.0, 1, 0.0, 24, "終わった終わった\n一人でもなんとか\nなるもんだね", "2030/12/17 14:59:59", "リン", 24003, 10040, 102601);
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES ("2020/04/30 12:00:00", 2, 0.0, 3, 0.0, 2, 0.0, 24, "やったね！\nこれでようやく\nサボれるよ…", "2030/12/17 14:59:59", "リン", 24004, 10040, 102601);
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES ("2020/04/30 12:00:00", 1, 0.0, 4, 0.0, 1, 0.0, 24, "チーズが欲しいなら\nきちんと働いて\n買いに来なよ", "2030/12/17 14:59:59", "リン", 24005, 10040, 102601);
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES ("2020/04/30 12:00:00", 2, 0.0, 5, 0.0, 2, 0.0, 24, "あたしを敵に回した\n恐ろしさ\n思い知ったか！", "2030/12/17 14:59:59", "リン", 24006, 10040, 102601);
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES ("2020/04/30 12:00:00", 2, 0.0, 6, 0.0, 2, 0.0, 24, "あたしも意外と\nやるもんでしょ？", "2030/12/17 14:59:59", "リン", 24007, 10040, 102601);
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES ("2020/04/30 12:00:00", 4, 0.0, 7, 0.0, 4, 0.0, 24, "疲れた…\nねずみの逃げ足\n速すぎるよ…", "2030/12/17 14:59:59", "リン", 24008, 10040, 102601);
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES ("2020/04/30 12:00:00", 4, 0.0, 8, 0.0, 4, 0.0, 24, "このままじゃ\nまっひ～に\n叱られちゃうよ", "2030/12/17 14:59:59", "リン", 24009, 10040, 102601);
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES ("2020/04/30 12:00:00", 4, 0.0, 9, 0.0, 4, 0.0, 24, "まじめに\nやったんだけどな…\n悔しいな～", "2030/12/17 14:59:59", "リン", 24010, 10040, 102601);
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES ("2020/04/30 12:00:00", 4, 0.0, 10, 0.0, 4, 0.0, 24, "やられた…\nねずみって意外と\nてごわいね", "2030/12/17 14:59:59", "リン", 24011, 10040, 102601);
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES ("2020/04/30 12:00:00", 4, 0.0, 11, 0.0, 4, 0.0, 24, "おのれ～\nあたしのチーズを\n盗みやがって～！", "2030/12/17 14:59:59", "リン", 24012, 10040, 102601);
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES ("2020/04/30 12:00:00", 1, 0.0, 12, 0.0, 4, 1.81, 24, "疲れた…\nけど、次こそは\n守り抜くよ…", "2030/12/17 14:59:59", "リン", 24013, 10040, 102601);
